import React from "react";
import './button.css'

export default function Button({type, name, onClick}) {
    return (
        <div className="main">
            <button className="button" type={!!type ? type : 'submit'} onClick={onClick}>{!!name ? name : 'Submit'}</button>
        </div>
    )
}
